import React from 'react';

const Footer = () => {
  return (
    <footer>
      <p>Follow me on:
        <a href="https://github.com/awatson622">GitHub</a>,
        <a href="https://linkedin.com/in/yourprofile">LinkedIn</a>,
        <a href="https://stackoverflow.com/users/yourprofile">Stack Overflow</a>
      </p>
    </footer>
  );
};

export default Footer;
